import Input from './Input';
import formData from '../data/formData';

function Form() {
  formData.map((e)=>{
    return <form className="flex flex-col" action="#"></form>
    console.log(e.labelName);
    return (
    
      <Input
        labelName={e.labelName}
        forInput={e.forInput}
        typeInput={e.typeInput}
        placeholderInput={e.placeholder}
        />)
      })}

      export default Form;
